pragma solidity ^0.5.0;

import "node_modules/openzeppelin-solidity/contracts/ownership/Ownable.sol";

contract MarketPlace is Ownable {  
    //Mappings

    
    mapping (address => bool) public stores;
    mapping (address => bool) public sellers;
    mapping (address => bool) public admins;

    //Events

    event NewSellerAdded(address _sellerAddress);
    event NewAdminAdded(address _adminAddress);
    event NewStoreCreated(address  storeOwnerAddress);
    event ProductAdded(string name,  uint256 price, uint256 quantity);
    event PurchaseMade(uint256 indexed id, uint256 quantity);

    //Variables & constructor



    struct Item {
        string name;
        uint price;
        uint quantity;
    }

    struct seller {
        address  sellerAddress;
        uint256 balance;
        bool isSeller;
    }
    //Modifiers

    modifier onlyAdmin() {
        require(admins[msg.sender] == true);
        _;
    }

    modifier onlySeller(){
        require(sellers[msg.sender] == true);
        _;
    }

   //functions


    function addAdmin(address newAdmin) public onlyOwner returns(bool) {
        admins[newAdmin] = true;
        emit NewAdminAdded(newAdmin);
        return admins[newAdmin];
    }

    function addStoreOwner(address newSeller) public onlyAdmin returns(bool){
        sellers[newSeller] = true;
        emit NewSellerAdded(newSeller);
        return sellers[newSeller];   
            
    }

    
}
